MultipartFormDataContent formData = new MultipartFormDataContent();

foreach (DataRow r in filePaths.Rows) {
	String fP = (String)r[0];
	StreamContent fileContent = new StreamContent(new FileStream(fP, FileMode.Open, FileAccess.Read));
	fileContent.Headers.ContentType = new System.Net.Http.Headers.MediaTypeHeaderValue("application/pdf");
	String fileName = fP.Substring(fP.LastIndexOf('\\') + 1);
formData.Add(fileContent, fileName, fileName);
}

HttpClient request = new HttpClient();
request.DefaultRequestHeaders.Add("Authorization", "Basic " + credsencoded);
Task<HttpResponseMessage> t = request.PostAsync(workUrl, formData);

response = t.GetAwaiter().GetResult().Content.ReadAsStringAsync().Result;

